import "./Home.scss";
import Latest from "../../components/Latest/Latest";
import Posts from "../../components/Posts/Posts";
import styled from "styled-components";

const Home = () => {
  return (
    <div className="home">
      <Latest />
      <Posts />
    </div>
  );
};

const HomeStyles = styled.div`
  background-color: black;
`;

export default Home;
